import axios from 'axios';
import { ThunkAction } from 'redux-thunk';
import { getRegion } from '../modules/auth/pages/SignUpService';

export const GET_REGION_SUCCESS = 'GET_REGION_SUCCESS';

export const addTodo = (): ThunkAction<void, null, Action<string>> => {
  return async (dispatch) => {
    try {
      const response = await getRegion();
      dispatch({ type: GET_REGION_SUCCESS, payload: response.data.data });
    } catch (error) {
      console.error(error);
    }
  };
};
